      <Typography fontWeight={600} fontSize={18} mb={0.5}>Erasmus Sınavı 1</Typography>
      <Typography fontSize={14} color="#555">B1 Testlerine Erasmus Sınavı 1 soruları için tıklayın.</Typography>
